column36:
Resumo de 9 dias de campanha eleitoral, dos candidatos ao círculo eleitoral de Portalegre, do Partido CHEGA..
Dia 11, em Arronches;
Dia 12, em Campo Maior;
Dia 13, Arruada em Portalegre e Jantar Comício, no Hotel Rural de Arronches; (Presença do Dr.André Ventura).
Dia 14, em Monforte;
Dia 15, em Alter;
Dia 18, em Avis e Ponte de Sor;
Dia 19, em Nisa e Gavião;
Dia 20, Debate na Rádio Portalege;
Dia 21, Apresentação dos Candidatos, em Portalegre;

Excepto os dias 20 e 21, os outros, foram ocupados no contacto directo com as populações locais, comercio e instituições...
e
Deparo me com o caso mais grave de despovoamento e de declínio no país. Indigna- me ver ver este  fenómeno no interior, onde a maioria da população é idosa! Jovens nem sombras deles! Ruas completamente vazias! Ruas inteiras de habitações devolutas!!
Ruas cheias de placas, "vende se" "aluga-se" ..
Tenho sido testemunha desta realidade inquietante. É um território que se vai esvaindo a olhos vistos.

Não espero, infelizmente encontrar melhor situações nos concelhos que faltam visitar.. Espero que as nossas propostas sejam úteis para inverter o rumo desta triste e preocupante realidade..

Ser eleito ou não, o importante é assumir o COMPROMISSO, que vamos levar as nossas propostas para a Assembleia da República, para que sejam apresentadas pelo Grupo Parlamentar do Chega na Legislatura já em 2022.

Última semana de Campanha:

Dia 22, Portalegre - Concentração às 09h no Mercado Municipal;
Dia 25, Elvas,
Dia 26, Sousel e Fronteira
Dia 27, Marvão, Castelo de Vide e
Marvão, 
Dia 28, Portalegre - Encerramento.
Contamos com todos.. Todos são importantes para a mudança necessária!
Júlio Paixão
Cabeça de lista.
